import React from 'react';
import { Text, Pressable, StyleSheet,Image,View } from 'react-native';
import { Icon } from 'react-native-elements'

export default function Navi(){
    return (

            <View style={styles.container}>
                <Icon
                        name="file-signature"
                        type='font-awesome-5'
                        size={25}
                        color= 'white'
                        solid={true}
                />
                <Icon
                        name="envelope"
                        type='font-awesome-5'
                        size={25}
                        color= 'white'
                        solid={true}
                />
                <View style={styles.circle}>
                <Icon
                        style={styles.home}
                        name="home"
                        type='font-awesome-5'
                        size={60}
                        color= 'white'
                        solid={true}
                />
                </View>
                <Icon
                        name="hotel"
                        type='font-awesome-5'
                        size={25}
                        color= 'white'
                        solid={true}
                />
                <Icon
                        name="user"
                        type='font-awesome-5'
                        size={25}
                        color= 'white'
                        solid={true}
                />
            </View>
    )
}

const styles = StyleSheet.create({
    container:{
        backgroundColor:"#D98236",
        height: 50,
        flexDirection: "row",
        justifyContent: "space-around",
        alignItems: "center"
    },
    circle:{
        backgroundColor:"#D98236",
        height: 160,
        width:160,
        alignItems:"center",
        justifyContent:"center",
        borderRadius:100,
        bottom: -30
    },
    home:{
        marginBottom:80
    }
})
